eval("module.exports = /*#__PURE__*/JSON.parse('[{\"title\":\"To Kill a Mockingbird\",\"author\":\"Harper Lee\",\"summary\":\"A lawyer\\'s advice to his children as he defends the real mockingbird of Harper Lee\\'s classic novel - a black man charged with the rape of a white girl. Through the young eyes of Scout and Jem Finch, Harper Lee explores with exuberant humour the irrationality of adult attitudes to race and class in the Deep South of the 1930s. The conscience of a town steeped in prejudice, violence and hypocrisy is pricked by the stamina of one man\\'s struggle for justice. But the weight of history will only tolerate so much.\",\"rating\":4.9,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1553383690i/2657.jpg\",\"genre\":\"Fiction\",\"publicationYear\":1960,\"ISBN\":\"978-0061120084\"},{\"title\":\"1984\",\"author\":\"George Orwell\",\"summary\":\"A masterpiece of rebellion and imprisonment where war is peace freedom is slavery and Big Brother is watching. Thought Police, Big Brother, Orwellian - these words have entered our vocabulary because of George Orwell\\'s classic dystopian novel 1984. The story of one man\\'s Nightmare Odyssey as he pursues a forbidden love affair through a world ruled by warring states and a power structure that controls not only information but also individual thought and memory 1984 is a prophetic haunting tale More relevant than ever before 1984 exposes the worst crimes imaginable the destruction of truth freedom and individuality. With a foreword by Thomas Pynchon. This beautiful paperback edition features deckled edges and french flaps a perfect gift for any occasion\",\"rating\":4.8,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1657781256i/61439040.jpg\",\"genre\":\"Dystopian\",\"publicationYear\":1949,\"ISBN\":\"978-0451524935\"},{\"title\":\"The Great Gatsby\",\"author\":\"F. Scott Fitzgerald\",\"summary\":\"The Great Gatsby, F. Scott Fitzgerald’s third book, stands as the supreme achievement of his career. First published in 1925, this quintessential novel of the Jazz Age has been acclaimed by generations of readers. The story of the mysteriously wealthy Jay Gatsby and his love for the beautiful Daisy Buchanan, of lavish parties on Long Island at a time when The New York Times noted “gin was the national drink and sex the national obsession,” it is an exquisitely crafted tale of America in the 1920s.\",\"rating\":4.7,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1650033243i/41733839.jpg\",\"genre\":\"Classic\",\"publicationYear\":1925,\"ISBN\":\"978-0743273565\"},{\"title\":\"Pride and Prejudice\",\"author\":\"Jane Austen\",\"summary\":\"Pride and Prejudice has charmed generations of readers for more than two centuries. Jane Austen\\'s much-adapted novel is famed for its witty, spirited heroine, sensational romances, and deft remarks on the triumphs and pitfalls of social convention. Author Jane Austen (1775-1817) was an English novelist whose works of social realism achieved unprecedented critical and popular success, though Austen herself remained an anonymous writer throughout her life.\",\"rating\":4.8,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1681804503i/129915654.jpg\",\"genre\":\"Romance\",\"publicationYear\":1813,\"ISBN\":\"978-1503290563\"},{\"title\":\"The Catcher in the Rye\",\"author\":\"J.D. Salinger\",\"summary\":\"Fleeing the crooks at Pencey Prep, he pinballs around New York City seeking solace in fleeting encounters—shooting the bull with strangers in dive hotels, wandering alone round Central Park, getting beaten up by pimps and cut down by erstwhile girlfriends. The city is beautiful and terrible, in all its neon loneliness and seedy glamour, its mingled sense of possibility and emptiness. Holden passes through it like a ghost, thinking always of his kid sister Phoebe, the only person who really understands him, and his determination to escape the phonies and find a life of true meaning.\",\"rating\":4.5,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1398034300i/5107.jpg\",\"genre\":\"Literary Fiction\",\"publicationYear\":1951,\"ISBN\":\"978-0316769488\"},{\"title\":\"The Hobbit\",\"author\":\"J.R.R. Tolkien\",\"summary\":\"Written for J.R.R. Tolkien’s own children, The Hobbit met with instant critical acclaim when it was first published in 1937. Now recognized as a timeless classic, this introduction to the hobbit Bilbo Baggins, the wizard Gandalf, Gollum, and the spectacular world of Middle-earth recounts of the adventures of a reluctant hero, a powerful and dangerous ring, and the cruel dragon Smaug the Magnificent.\",\"rating\":4.9,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1546071216i/5907.jpg\",\"genre\":\"Fantasy\",\"publicationYear\":1937,\"ISBN\":\"978-0547928227\"},{\"title\":\"The Alchemist\",\"author\":\"Paulo Coelho\",\"summary\":\"Paulo Coelho\\'s masterpiece tells the mystical story of Santiago, an Andalusian shepherd boy who yearns to travel in search of a worldly treasure. His quest will lead him to riches far different—and far more satisfying—than he ever imagined. Santiago\\'s journey teaches us about the essential wisdom of listening to our hearts, recognizing opportunity and learning to read the omens strewn along life\\'s path, and, most importantly, following our dreams.\",\"rating\":4.6,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1654371463i/18144590.jpg\",\"genre\":\"Fiction\",\"publicationYear\":1988,\"ISBN\":\"978-0061122415\"},{\"title\":\"Harry Potter and the Sorcerer\\'s Stone\",\"author\":\"J.K. Rowling\",\"summary\":\"Harry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry\\'s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin!\",\"rating\":4.9,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1598823299i/42844155.jpg\",\"genre\":\"Fantasy\",\"publicationYear\":1997,\"ISBN\":\"978-0590353427\"},{\"title\":\"The Road\",\"author\":\"Cormac McCarthy\",\"summary\":\"A father and his son walk alone through burned America. Nothing moves in the ravaged landscape save the ash on the wind. It is cold enough to crack stones, and when the snow falls it is gray. The sky is dark. Their destination is the coast, although they don’t know what, if anything, awaits them there. They have nothing; just a pistol to defend themselves against the lawless bands that stalk the road, the clothes they are wearing, a cart of scavenged food—and each other.\",\"rating\":4.7,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1600241424i/6288.jpg\",\"genre\":\"Post-Apocalyptic Fiction\",\"publicationYear\":2006,\"ISBN\":\"978-0307387899\"},{\"title\":\"The Book Thief\",\"author\":\"Markus Zusak\",\"summary\":\"It is 1939. Nazi Germany. The country is holding its breath. Death has never been busier, and will be busier still.By her brother\\'s graveside, Liesel\\'s life is changed when she picks up a single object, partially hidden in the snow. It is The Gravedigger\\'s Handbook, left behind there by accident, and it is her first act of book thievery. So begins a love affair with books and words, as Liesel, with the help of her accordian-playing foster father, learns to read. Soon she is stealing books from Nazi book-burnings, the mayor\\'s wife\\'s library, wherever there are books to be found.\",\"rating\":4.8,\"image\":\"https://images-na.ssl-images-amazon.com/images/S/compressed.photo.goodreads.com/books/1522157426i/19063.jpg\",\"genre\":\"Historical Fiction\",\"publicationYear\":2005,\"ISBN\":\"978-0375842207\"}]');\n\n//# sourceURL=webpack:///./src/data/books.json?");

